import React, {Fragment} from "react";
import Table from "react-bootstrap/Table"

const DisplayShifts = (props) => {
    
    const getMemberName = async () => {
        try {
          let response = await axios.get(`http://127.0.0.1:8000/api/auth/${userid}/`,
          {
            headers: {
              Authorization: "Bearer " + token
            }
          }
          );
          console.log(response.data)
          setMemberName(response.data);
        } catch (error) {
            if (axios.isCancel(error)) {
              return false;
            }
          console.log("error with getting user's name")
          }
        return null
      };

    return (
        <Fragment>
            {props.getAllShiftsProperty &&
                props.getAllShiftsProperty.map((shift, index) => {
                    return(
                        <tr>
                            <td>{shift.name}</td>
                            <td>{shift.start}</td>
                            <td>{shift.end}</td>
                            <td>{shift.qual_required}</td>
                            <td>{shift.nurse_id}</td>
                        </tr>
            )
                }
            )}
            {props.getAllNurseProperty &&
                props.getAllNurseProperty.map((nurse, index) => {
                    return(
                        <tr>
                            <td>{nurse.first_name}</td>
                        </tr>
                    )
                }
            )}
        </Fragment> 
    );
}
 
export default DisplayShifts;
